import styled from 'styled-components'

export const StyledButton = styled.button`
	background-color: blue;
	cursor: pointer;
	margin: 1rem 0;
`
export const StyledContent = styled.div`
	height: 15rem;
	width: 100%;
	display: flex;
	justify-content: space-between;
	padding-bottom;
`
